import {FaUserCircle} from 'react-icons/fa'
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.min.js';
import {useState, useEffect} from 'react'
import {useCookies} from 'react-cookie'

export default function Navbar(flags) {

  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [token, setToken, removeToken] = useCookies(['access-token'])
  const [refreshToken, setRefreshToken, removeRefreshToken] = useCookies(['refresh-token'])
  const [dialog, setDialog] = useState('')

  let flag;
  if(token){
    flag = true
  }else{
    flag = false
  }

  const [isLoggedIn, setIsLoggedIn] = useState(flag)

  function LoginButton(props){
      return (
        <button className="btn btn-success" type="submit" onClick={loginClicked} style={{position: 'relative', left: '650px'}}><FaUserCircle style={{position: 'relative', right: '5px', bottom: '1px'}}className="icon" size={20}/>
Login</button>
      )
    }

  function LogoutButton(){
    return (
      <button className="btn btn-success" type="submit" onClick={logoutClicked} style={{position: 'relative', left: '650px'}}><FaUserCircle style={{position: 'relative', right: '5px', bottom: '1px'}}className="icon" size={20}/>
Sign Out</button>
    )
  }

  function logoutClicked(){
    removeToken("access-token")
    removeRefreshToken("refresh-token")
    setIsLoggedIn(false)
    setDialog("You have succesfuly logged out.")
    console.log("after logoutClicked, isLoggedIn: " + isLoggedIn)
    window.location.href = "http://localhost:8000/"
  }

  function loginClicked(){
    /*
    console.log("token= ", Object.keys(token).length)
    console.log("token= ", Object.keys(token))
    console.log("token= ", token['refresh-token'])
    console.log("token= ", token.toString())

    if(Object.keys(token).length != 0){
      console.log("in")
      setIsLoggedIn(true)
      console.log("after loginClicked, isLoggedIn: " + isLoggedIn)
    */
    window.location.href = "http:localhost:8000/login/"

  }

  useEffect(() => {
    console.log("flag= ",isLoggedIn)
  })

  //TODO: Check token and put sign in or sign out tokens.
  let button;
  if(!isLoggedIn){
    button = <LoginButton onClick={loginClicked}/>;
  }else{
    button = <LogoutButton onClick={logoutClicked}/>;
  }

  return(
    <nav className="navbar sticky-top navbar-expand-lg navbar-dark bg-dark">
        <div className="container-fluid">
        <a className="navbar-brand" href="http://localhost:3000/">Royar</a>
        <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNavAltMarkup" aria-controls="navbarNavAltMarkup" aria-expanded="false" aria-label="Toggle navigation">
                <span className="navbar-toggler-icon"></span>
            </button>
        <div className="collapse navbar-collapse " id="navbarNavAltMarkup">
          <div className="navbar-nav me-auto">
            <a className="nav-link active" aria-current="page" href="http://localhost:3000/">Home</a>
            <a className="nav-link" href="http://localhost:3000/buy/">Buy</a>
            <a className="nav-link" href="http://localhost:3000/sell/">Sell</a>
            <a className="nav-link" href="http://localhost:3000/rent/">Rent</a>
            <a className="nav-link" href="http://localhost:3000/help/">Help</a>
            <a className="nav-link" href="http://localhost:3000/about/">About Us</a>
            {button}
            <form className="d-flex" style={{position: 'relative', left: '660px'}}>
              <input className="form-control me-2" type="search" placeholder="Search" aria-label="Search"/>
              <button className="btn btn-success" type="submit">Search</button>
            </form>
          </div>
        </div>
        </div>
    </nav>
  )
}
